import "./Cards.css";

function Cards(){
    const lista = [
        {
            titulo: "Teste 123",
            subtitulo: "Teste 123",
            preco: "R$13.99"
        },
        {
            titulo: "Teste 1234",
            subtitulo: "Teste 1234",
            preco: "R$14.99"
        },
        {
            titulo: "Teste 321",
            subtitulo: "Teste 321",
            preco: "R$15.99"
        },
        {
            titulo: "Teste 4321",
            subtitulo: "Teste 4321",
            preco: "R$16.99"
        },
        {
            titulo: "Teste 9475",
            subtitulo: "Teste 9475",
            preco: "R$17.99"
        }
    ];


    return (
        <div className="Cards">
            {lista.map(function(item, i){
                return <p>{item.titulo}</p>
            })}
        </div>
    );
}

export default Cards;
